import React from 'react';

import Card from './Card.jsx';

export default function Cards({ cites }) {
	// acá va tu código
	// tip, podés usar un map

	return (
    <div>
      {cites.map((city, i) => (
				<Card
					key={i}
					max={city.max}
					min={city.min}
					name={city.name}
					img={city.img}
					onClose={() => alert(city.name)}
				/>
			))}
		</div>
	);
}
